import React from 'react';
import './ProfileHeader.css'; // Fichier CSS pour ce composant
import NavbarHome from './NvbarHome';
import { FaPlane } from 'react-icons/fa';
const ProfileHeader = () => {
 return (
  <>
  <NavbarHome/>
    <div className="airport-header">
      {/* Ligne d'aéroport avec icône */}
      <div className="airport-row">
        <div className="airport-icon">
          <FaPlane className="plane-icon" />
        </div>
        <div className="airport-info">
          <span className="airport-name">MEDVI Casablanca Airport</span>
          <span className="airport-code">(CMN)</span>
        </div>
      </div>

      {/* Salutation */}
      <div className="greeting">HELLO CHAYMAE!</div>

      {/* Carte de membre */}
      <div className="membership-card">
        <div className="membership-id">
          <span className="membership-label">Safar Flyer</span>
            <span className="membership-number">N° 678908451</span>
        </div>
        <div className="miles-balance">10000 Award miles</div>
      </div>
    </div>
    </>
  );
};

export default ProfileHeader;
